const NavbarLink = ({ children, ...props }) => (
  <NavLink px={5} {...props}>
    {children}
  </NavLink>
);

const Navbar = () => (
  <Flex alignItems="center" justifyContent="space-between" px={5} py={4}>
    <Flex flexDirection="row" justifyContent="center" alignItems>
      <Link href="/">
        <a>Jobaho</a>
      </Link>
    </Flex>
    <Box>
      <NavbarLink>
        <Link href="/">
          <a>Home</a>
        </Link>
      </NavbarLink>
      <NavbarLink>
        <Link href="/about">
          <a>About</a>
        </Link>
      </NavbarLink>
      <NavbarLink>
        <Link href="/jobSection">
          <a>Find a Job</a>
        </Link>
      </NavbarLink>
    </Box>
  </Flex>
);

export default Navbar;
